import * as React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { TravellerLandingScreen } from './travellerLanding.screen';
import { TravellerRatingScreen } from './travellerRating.screen';


const Tab = createBottomTabNavigator();

export const TravellerTabNavigation = () => {
  return (
      <Tab.Navigator>
        <Tab.Screen name="TravellerLandingScreen" component={TravellerLandingScreen} />
        <Tab.Screen name="TravellerRatingScreen" component={TravellerRatingScreen} />
      </Tab.Navigator>
  );w
}
